PresentationsPerBrug_1.query:
q = load "GeneratedSlidesDataset";
q = foreach q generate 'Join5.User.Name' as 'OwnerId', 'andmoney__3.Id' as 'SlideDeckId';
q = group q by ('SlideDeckId', 'OwnerId');
q = foreach q generate 'OwnerId', 'SlideDeckId';
q = group q by 'OwnerId';
q = foreach q generate 'OwnerId', count() as 'SlideDeckCount';

AverageNumberOfSlide_1.query:
q = load "GeneratedSlidesDataset";
q = group q by ('andmoney__3.Id', 'andmoney__2.Id');
q = foreach q generate 'andmoney__3.Id' as 'SlideDeckId', count() as 'SlideCount';
q = group q by all;
q = foreach q generate avg('SlideCount') as 'AverageSlideCount';
